  simtropolis/33621-wmp-mega-props-vol-01-misc-general-props:
    authors:
      - STEX Custodian
    category: 0
    dependencies: []
    description: >-
      The WMP Mega Props vol. 01 is the first dependency pack, which superseds many of the previously released single, individual WMP prop packs by DocRorlach.


      This is a dependency package, and it doesn't contain any ploppable or growable elements. Although it can be used for creating new lots with Maxis Lot Editor or PIM-X.


      Since the original workingman-productions.co.uk/ website is no longer up and running, the decision has been made, that these contents of DocRorlach's will be re-hosted on the main exchanges (LEX
      and STEX) as legacy contents on behalf of DocRorlach. For easier access and due to a more userfriendly approach, we put together these mega prop packs which are completely replacing the previous
      smaller prop packs.


      It is highly recommended to use the attached cleanitol file (WMP Mega Props Vol. 01-05 cleanitol.txt) and remove all the listed contents. The best way to do it, if you use the BSC Cleanitol TM
      (v1.0) tool. Install the application (if you don't already have), run it, browse the attached *.cleanitol.txt file and let the program remove the listed elements.


      Also from now, these mega prop packs are required to be referenced as dependencies instead of the single prop packs.


      Installation: Unzip the whole bundle, or COPY the "WMP" folder from the *.zip into your plugin folder. You don't need to keep the "_Documents" folder. To uninstall, bulldoze any instance of this
      lot in your city, then remove the file(s) from your Plugins.


      For further details, please read the provided readme AND IF you still have questions, ask @Tyberius06.


      Credits:

        -  DocRorlach and the WMP team for creating the models, props and the original prop packs.
        -  David (djp) for keeping the original site alive so many years, and letting us rehosting the files on the exchanges
        -  xxdita and Tyberius06 (and the STEX Custodian) for putting together the mega packs and making the files available again.

       Support:

      These WMP/DocRorlach creations are now legacy contents and therefore their support is very limited, however support from the wider community can be requested here or in the STEX Custodian
      General Support Topic. Best include a screen-shot illustrating the problem.
